function scrollPage($target,event){$("html, body").stop().animate({scrollTop:$target.offset().top-70},1500,"easeInOutExpo");event&&event.preventDefault();}function collapseNavbar(){if($(".navbar").offset().top>50){return $(".navbar-fixed-top").addClass("top-nav-collapse");}return $(".navbar-fixed-top").removeClass("top-nav-collapse");}$(function(){$("a.page-scroll").bind("click",function(event){scrollPage($(this).attr("href"),event);});});$(".navbar-collapse ul li a").click(function(){$(this).closest(".collapse").collapse("toggle");});$(window).scroll(collapseNavbar);$(document).ready(function($){collapseNavbar();if(_prefilled){scrollPage($("div#search-results"));}else{alert("nope");}});